pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721Full.sol"; //  

contract YouTubeThumbnailToken is ERC721Full { //ERC721Full openzepplin 

    struct YouTubeThumbnail {
        string author;
        string dateCreated;
    }

    mapping(uint256 => YouTubeThumbnail) youTubeThumbnails; // tokenId(key) -> (author, dateCreated)
    mapping(string => uint256) videoIdsCreated; // videoId(key) -> tokenId

    // ERC721Full     ( deploy_YTT name,symbol )
    constructor(string memory name, string memory symbol) ERC721Full(name, symbol) public {}

    //   
    function mintYTT(
        string memory _videoId,
        string memory _author,
        string memory _dateCreated,
        string memory _tokenURI // JSON Metadata   ->   
    )
        public
    {
        require(videoIdsCreated[_videoId] == 0, "videoId has already been created"); //videoId key    ,  
        uint256 tokenId = totalSupply().add(1); //    + 1 tokenId 
        youTubeThumbnails[tokenId] = YouTubeThumbnail(_author, _dateCreated); // tokenId    
        videoIdsCreated[_videoId] = tokenId; //videoId  tokenId  =>  videoId    

        _mint(msg.sender, tokenId); //  (ERC721, ERC721Enumerable   )
                                    //      ?
                                    // solidity    C3 Linearization  ->    
                                    // ERC721Enumerable  _mint 

        _setTokenURI(tokenId, _tokenURI); //ERC721MetaData 
                                          //tokenURI - tokenId(key) mapping
                                          //   URI   
    }

    //    tokenId -> author, dateCreated
    function getYTT(uint256 _tokenId) public view returns(string memory, string memory) {
        return (youTubeThumbnails[_tokenId].author, youTubeThumbnails[_tokenId].dateCreated);
    }

    // videoId ->   (bool)
    function isTokenAlreadyCreated(string memory _videoId) public view returns (bool) {
        return videoIdsCreated[_videoId] != 0 ? true : false;
    }
}
